import React, { Component } from 'react';
import logo from './logo.svg';
import Mycalendar from "./common/myCalender";
import DatePickerLimit from 'react-date-picker-provider'
import './App.css';
import "./common/Mycalendar.css";


class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <Mycalendar />
        </header>
      </div>
    );
  }
}

export default App;
